import React, {Component} from 'react';
import {NavLink} from 'react-router-dom';
import logo from '../images/logo.png'
import './NavBar.css'
import MenuButton from "./HamburgerButton/HamburgerButton";
import ToggleNav from "./ToggleNav/ToggleNav";


class NavBar extends Component {
    constructor(props){
        super(props);
        this.state = {
            tabs:['Home','About Us','Contact Us','FAQs','MEMBERS'],
            open:false,
        };
    }

    handleClick=()=>{
        this.setState((prevState)=>{
            return {open:!prevState.open}
        })
    };

    render() {
        let toggleNav;
        if (this.state.open) {
            toggleNav = <ToggleNav bgClick={this.handleClick}/>
        }
        return (
            <div className="newNav">
                <nav className="nav_bar">
                    <div className="logo_container">
                        <img className="genbukan_logo" src={logo} alt="logo"/>
                    </div>
                    <div className="menuBtn">
                        <MenuButton open={this.state.open} onClick={this.handleClick}/>
                    </div>

                </nav>
                {toggleNav}
            </div>
        );
    }
}

export default NavBar;
